Up for trade is a military simulator, projectile, ground burst: M115A2. Live simulator. 

Directions;
Hold simulator in throwing hand wearing a standard issue leather glove. With other hand, remove safety clip. Carefully remove cap until cord is free. JERk CORD ONCE-THROW simulator immediately and turn away, 

Hazards;
Serious injury can result if simulator is not thrown promptly. Do not pick up a simulator that fails to explode. Dry leaves and grass may be ignited. The explosion may propel gravel, sticks, fragments, etc at a high velocity. Personnel closer than 35 meters may be injured by flying fragments.
